// src/components/sections/Product/Product.jsx
import React from 'react';
import './Product.scss';

const Product = () => {
  return (
    <section id="product" className="product">
      <h2>Product</h2>
      <div className="product-content">
        {/* Add product content here */}
      </div>
    </section>
  );
};

export default Product;
